import React from "react";
import { styled } from "styled-components";
import backgroundImg from "../Assets/mvp-banner.png";
const Home = () => {
  const PageDiv = styled.div`
    height: 100vh;
    color: white;
    padding: 3rem;
    background-image: ${backgroundImg};
  `;
  const ContainerDiv = styled.div`
    width: 45%;
    margin: auto;
    text-align: center;
  `;

  const P = styled.p`
    font-family: "Barlow", sans-serif;
    font-size: 3rem;
  `;
  const Pl = styled.p`
    font-family: "Satisfy", cursive;
    color: #fdc913;
    margin-bottom: 0;
    font-size: 1.5rem;
  `;
  return (
    <PageDiv>
      <ContainerDiv className="container">
        <Pl>Lezzeti Kaçırma</Pl>
        <P>KOD ACIKTIRIR</P>
        <P>PİZZA DOYURUR</P>
      </ContainerDiv>
    </PageDiv>
  );
};
export default Home;
